import React from 'react';

const toolbar = props => (
    <header>
        <nav>
            <div> </div>
            <div>THE LOGO </div>
            <div>
                <ul>
                    <li>Products</li>
                    <li>Users</li>
                </ul>
            </div>
        </nav>
    </header>
);

export default toolbar;
